import React from 'react';
import { Link } from 'react-router-dom';
import '../styles.css';

function Header({ changeComponent }) {
  return (
    <div>
      <header>
        <Link to="/" className="title-link">
          <h1 onClick={() => changeComponent('main')}>GESTOR DE FP</h1> {/* Llama a la funci칩n changeComponent para mostrar el componente Main */}
        </Link>
      </header>
      <div className="body">
        <div className="container">
          <div className="button-container">
            <div className="button" onClick={() => changeComponent('addStudent')}>A침adir Alumno</div> {/* Llama a la funci칩n changeComponent para mostrar el componente AddStudent */}
            <div className="button" onClick={() => changeComponent('getAllStudents')}>Mostrar Alumnos</div> {/* Llama a la funci칩n changeComponent para mostrar el componente GetAllStudents */}
            {/* Otros botones del Header */}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Header;
